// src/pages/Home.js
import React from 'react';
import styled from 'styled-components';

const HomeContainer = styled.div`
  padding: 2rem;
  text-align: center;
`;

function Home() {
  return (
    <HomeContainer>
      <h1>Bienvenue sur mon Portfolio</h1>
      <p>Ceci est la page d'accueil de mon site portfolio.</p>
    </HomeContainer>
  );
}

export default Home;
